import React from "react";

const Hero = () => {
  return (
    <div className="hero">
      <p>
        Your Ultimate RPG Note-Taking Tool - Find, Sort, and Create in a Snap!
        <br />
        <br />
        You can find your RPG notes in a few clicks. <br />
        <br />
        It's the ideal companion for all role-players
      </p>
    </div>
  );
};

export default Hero;
